text:
 @トラキアS  今回の結論を書いたまでや。
てかおれにリプせーへん言ってたんちゃうの？
構って欲しいんかはこっちのセリフや。

 @おぱんちゅ  
どちらが、じゃないな。
モラルのないコメントがあるのも事実だ。

 @アポロ  
別にガチ恋って誰も言ってないし
普通のリスナーだよ

 @アポロ  吾はオタクとしてホロライブプロダクションを推している者だがVが絵なら人間は肉の塊じゃないかい？
肉の塊に恋するのと絵に恋するの何の違いがあるのかぜひ知りたい。
ただ純粋に違いが知りたいだけだから出来れば教えてほしいわ。

 @le de  あー…メンヘラとかだったんですか( ;´꒳`;)
お互い今荒れてるので精神的にキツそうですよね〜
そんな厳しくあたってたつもりはないですけど、まふまふさんが謝ったのにるしあさんから何か一言ないのかな？と思っただけです。

 @カバの煮物  
ありがとう。大勢からの声って純粋に怖いって知ってるから、少しは気持ちわかるからさぁ。
雰囲気を作るのはリスナーにしか出来ないから出来ることで助けていこう。

 @コットン  
どっちも有名人かつ相当なアンチが裏にへばりくっついてた人達だからな……
それが表に湧いてでてきるんやろ…

 @私が論破されたことは置いといて…  
再生数でマウント取るのはよくないぞ
170万再生、通ります

 @ねるねる  
まぁ、俺や君と違って遊ぶことで金を得られる勝ち組だからなぁw
羨ましい限りだよねぇw

 @ねるねる  
そのぐらいで幻滅するとか、本当にファンか疑いたくなる
あ、粗探ししてるだけだから仕方ないか

@ねるねる
おまえほんとに僕が見る動画全部にいるね♡ 
気が合うね♡

 @ねるねる  
ねるねる邪魔だ
出てけるしあの世界に邪魔するな

 @ねるねる  
きっとツンデレっていう属性持ちなんだね！
君も心の中ではるしあ様のことが大好きなんでしょ？

 @来年から高学歴 
 うわぁぁぁぁぁ‼️やめてくれ～～‼️
現実なんてクソだぁぁ～‼️俺はまた明日起きたら仕事なんだよぉ～‼️彼女いないチー牛陰キャはここだけが癒しなんだぁ～～‼️るしあ可愛い最高だぜぇ～✨

